import Container from "../components/Container";
import axios from 'axios';

const Index = (props) => {
    console.log(props);
  return (
    <Container title="Home">
      <h3>Hola</h3>
    </Container>
  );
};

Index.getInitialProps = (ctx) => {
   axios.get("https://rickandmortyapi.com/api/character")
   .then(res=>{
       console.log(res)
       return {}
   })
};

export default Index;
